import React from 'react';

function Hero() {
	return (
		<div classname="hero-wrapper">
			<div classname="hero-content">
				<div classname="hero-column1">
					<h1>Hero col 1</h1>
				</div>
				<div classname="hero-column2">
					<h1>Hero col 2</h1>
				</div>
			</div>
		</div>
	);
}

export default Hero;
